function Card(front, back, star){
    this.front = front;
    this.back = back;
    this.star = star;

    Card.prototype.getFront = function() {
        return front;
    }
    Card.prototype.getBack = function() {
        return back;
    }
    Card.prototype.setFront = function() {
        this.front = front;
    }
    Card.prototype.setBack = function() {
        this.back = back;
    }
}

//module.exports =Card;

export default Card;
